import React from "react";

const CreateNote = (props) => {
  return (
    <>
      <div>
        <br />
        <input type="text" placeholder="Title" />
        <br />
        <textarea placeholder="Write a note..." rows="4" cols="21" />
        <button>+</button>
      </div>
    </>
  );
};

export default CreateNote;
